import zIndex from "@mui/material/styles/zIndex";
import { makeStyles } from "@mui/styles";

export const useStyles = makeStyles({
  loginForm:{
    display:'flex',
    flexDirection:'column',
    verticalAlign:'top',
    zIndex:100
  },
  backgroungLogin:{
    zIndex:-1,
    width:'100%',
    '& img':{
      width:'100%'
    }
  }
})
